import CostItem from "./components/Costs/CostItem";
import Costs from "./components/Costs/Costs";

function App() {
  const costs = [
    {
      date: new Date(2022, 2, 12),
      description: "Холодильник",
      amount: "999.99",
    },
    {
      date: new Date(2021, 11, 15),
      description: "MacBook",
      amount: "1254.75",
    },
    {
      date: new Date(2022, 1, 1),
      description: "Куртка",
      amount: "49.99",
    },
  ];

  return (
    <div>
      <h1>Расходы</h1>
      <Costs costs={costs} />
    </div>
  );
}

export default App;
